import React from "react";

const Registration = () => {
  return (
    <section>
      <div style={{ backgroundColor: "yellow", height: "1.4rem" }}>
        Create User
      </div>
      <form
        style={{
          fontSize: "20px",
        }}
      >
        <label for="f_Name">Name</label>
        <input type="text" name="f_Name" />
        <br />
        <label for="f_Email">Email</label>
        <input type="text" name="f_Email" />
        <br />
        <label for="f_Mobile">Mobile</label>
        <input type="text" name="f_Mobile" />
        <br />
        <label for="f_Designation">Designation</label>
        <select name="f_Designation">
          <option>Sales</option>
          <option>HR</option>
          <option>Operations</option>
        </select>
        <br />
        <label for="f_gender">Gender</label>

        <input type="radio" name="f_gender" />
      </form>
    </section>
  );
};
export default Registration;
